const Admin = () => {

    return <div>
        <h2>Admin Page</h2>
        <div>
            <form action="http://localhost:5000/countries/new" method="POST">
                <label for="name">Name:</label>
                <input type="text" id="name" name="name" required></input>
                <button>Submit</button>
            </form>
        </div>

    </div>;
}

export default Admin;
